webpackJsonp([0xa48b22373167],{765:function(a,n){a.exports={data:{markdownRemark:{html:'<p>React 可被灵活地运用在各种项目中。你可以用它创建新的应用程序，也可以逐渐地将其加入到现有的代码库中而无需重写。</p>\n<p>这里有几种你马上能上手的方式:</p>\n<ul>\n<li><a href="#%E5%B0%9D%E8%AF%95-react">尝试 React</a></li>\n<li><a href="#%E5%88%9B%E5%BB%BA%E6%96%B0%E5%BA%94%E7%94%A8">创建新应用</a></li>\n<li><a href="#%E6%B7%BB%E5%8A%A0-react-%E5%88%B0%E7%8E%B0%E6%9C%89%E5%BA%94%E7%94%A8">添加 React 到现有应用</a></li>\n</ul>\n<h2 id="尝试-react"><a href="#%E5%B0%9D%E8%AF%95-react" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>尝试 React</h2>\n<p>如果你只是想简单尝试下 React，可以使用 CodePen. 首先试试这个 <a href="http://codepen.io/gaearon/pen/rrpgNB?editors=0010">Hello World 示例代码</a>。你不需要安装任何东西，还能简单修改下代码使其生效。</p>\n<p>如果你喜欢使用自己的文本编辑器，你还可以 <a href="/downloads/single-file-example.html" download="hello.html">下载此 HTML 文件</a> 进行编辑, 然后在本地浏览器中打开。它会缓慢的执行代码转换，所以不要在生产环境中使用。</p>\n<p>如果你想在一个完整的项目中使用 React，一般有两种方式：创建 React 应用或添加 React 到现有应用。</p>\n<h2 id="创建新应用"><a href="#%E5%88%9B%E5%BB%BA%E6%96%B0%E5%BA%94%E7%94%A8" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>创建新应用</h2>\n<p><a href="http://github.com/facebookincubator/create-react-app">Create React App</a> 是开始构建新的 React 单页面应用的最佳途径。 它可以帮你配置开发环境，以便你可以使用最新的 JavaScript 特性，还能提供很棒的开发体验，并为生产环境优化你的应用。</p>\n<div class="gatsby-highlight">\n      <pre class="gatsby-code-bash"><code><span class="token function">npm</span> <span class="token function">install</span> -g create-react-app\ncreate-react-app my-app\n\n<span class="token function">cd</span> my-app\n<span class="token function">npm</span> start\n</code></pre>\n      </div>\n<p>Create React App 并不处理后端逻辑和数据库，它只会创建一个前端的构建管道，所以可以和任何后端搭配使用。它可以使用 Babel 和 Webpack 这样的配置工具，也可以零配置使用。</p>\n<p>当你准备好将其部署到生产环境中时，运行 <code>npm run build</code>  将会在 <code>build</code> 文件夹中创建一个优化好的应用。你可以从 <a href="https://github.com/facebookincubator/create-react-app#create-react-app-">README</a> 和 <a href="https://github.com/facebookincubator/create-react-app/blob/master/packages/react-scripts/template/README.md#table-of-contents">用户指南</a> 中了解更多信息。</p>\n<h2 id="添加-react-到现有应用"><a href="#%E6%B7%BB%E5%8A%A0-react-%E5%88%B0%E7%8E%B0%E6%9C%89%E5%BA%94%E7%94%A8" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>添加 React 到现有应用</h2>\n<p>你不需要为了使用 React 重写你的应用。</p>\n<p>我们建议你将 React 添加到应用的一小部分中，比如单个小部件，以便你看它是否适用于你的情况。</p>\n<p>虽然 React <a href="/docs/react-without-es6.html">可以在没有构建管道的情况下使用</a> ，但是为了更高效我是还建议你使用它，现代的构建管道通常包括:</p>\n<ul>\n<li><strong>包管理器</strong>，比如 <a href="https://yarnpkg.com/">Yarn</a> 或 <a href="https://www.npmjs.com/">npm</a>。它可以让你使用庞大的第三方软件包生态系统，还能很方便的安装或升级。</li>\n<li><strong>构建器</strong>，比如 <a href="https://webpack.js.org/">webpack</a> 或 <a href="http://browserify.org/">Browserify</a>。它允许你编写模块化代码并且压缩文件以优化加载时间。</li>\n<li><strong>编译器</strong> 比如 <a href="http://babeljs.io/">Babel</a>。它可以让包含新特性的代码运行在旧版浏览器上。</li>\n</ul>\n<h3 id="安装-react"><a href="#%E5%AE%89%E8%A3%85-react" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>安装 React</h3>\n<blockquote>\n<p><strong>注意：</strong></p>\n<p>一旦安装 React，我们强烈建议你将它配置为<a href="/docs/optimizing-performance.html#use-the-production-build">生产构建程序</a> ，以确保你在生产环境中使用最新版本的 React。</p>\n</blockquote>\n<p>我们建议使用 <a href="https://yarnpkg.com/">Yarn</a> 或 <a href="https://www.npmjs.com/">npm</a> 来管理前端的依赖关系, 如果你还未使用过包管理器，阅读 <a href="https://yarnpkg.com/en/docs/getting-started">Yarn 文档</a> 以快速入门。 </p>\n<p>使用 Yarn 安装 React：</p>\n<div class="gatsby-highlight">\n      <pre class="gatsby-code-bash"><code>yarn init\nyarn add react react-dom\n</code></pre>\n      </div>\n<p>To install React with npm, run:</p>\n<div class="gatsby-highlight">\n      <pre class="gatsby-code-bash"><code><span class="token function">npm</span> init\n<span class="token function">npm</span> <span class="token function">install</span> --save react react-dom\n</code></pre>\n      </div>\n<p>Yarn 和 npm 都会从 <a href="http://npmjs.com/">npm 仓库</a> 下载软件包。</p>\n<h3 id="使用-es6-和-jsx"><a href="#%E4%BD%BF%E7%94%A8-es6-%E5%92%8C-jsx" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>使用 ES6 和 JSX</h3>\n<p>我们推荐使用 <a href="http://babeljs.io/">Babel</a> 以便你在 JavaScript 中使用 ES6 和 JSX，ES6 拥有一系列 JavaScript 新特性的标准，能使你的开发更简单。JSX 是与 React 搭配使用的 JavaScript 语言的扩展。</p>\n<p><a href="https://babeljs.io/docs/setup/">Babel 安装说明</a> 说明了如何在多种不同的环境中配置 Babel，确保你已经安装了<a href="http://babeljs.io/docs/plugins/preset-react/#basic-setup-with-the-cli-"><code>babel-preset-react</code></a> 和 <a href="http://babeljs.io/docs/plugins/preset-es2015/#basic-setup-with-the-cli-"><code>babel-preset-es2015</code></a> 并且在 <a href="http://babeljs.io/docs/usage/babelrc/"><code>.babelrc</code> configuration</a> 配置文件中启用它们, 到这里就准备就绪了。</p>\n<h3 id="在-hello-world-中使用-es6-的-jsx"><a href="#%E5%9C%A8-hello-world-%E4%B8%AD%E4%BD%BF%E7%94%A8-es6-%E7%9A%84-jsx" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>在 Hello World 中使用 ES6 的 JSX</h3>\n<p>我们建议你使用像 <a href="https://webpack.js.org/">webpack</a> 或 <a href="http://browserify.org/">Browserify</a> 这样的构建工具，以便于编写模块代码并将其压缩，优化加载时间。</p>\n<p>下面是最基本的 React 示例：</p>\n<div class="gatsby-highlight">\n      <pre class="gatsby-code-jsx"><code><span class="token keyword">import</span> React <span class="token keyword">from</span> <span class="token string">\'react\'</span><span class="token punctuation">;</span>\n<span class="token keyword">import</span> ReactDOM <span class="token keyword">from</span> <span class="token string">\'react-dom\'</span><span class="token punctuation">;</span>\n\nReactDOM<span class="token punctuation">.</span><span class="token function">render</span><span class="token punctuation">(</span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>h1</span><span class="token punctuation">></span></span>Hello<span class="token punctuation">,</span> world<span class="token operator">!</span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>h1</span><span class="token punctuation">></span></span><span class="token punctuation">,</span>\n  document<span class="token punctuation">.</span><span class="token function">getElementById</span><span class="token punctuation">(</span><span class="token string">\'root\'</span><span class="token punctuation">)</span>\n<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>这段代码会将其渲染入一个 ID 为 <code>root</code> 的 DOM 元素，所以在你的 HTML 文件中需要有 <code>&#x3C;div id="root">&#x3C;/div></code>。</p>\n<p>类似以上，你可以在任何由其他 JavaScript UI 库编辑的现有应用中，将 React 渲染进一个 DOM 元素。</p>\n<p><a href="/docs/integrating-with-other-libraries.html#integrating-with-other-view-libraries">了解有关将 React 与现有代码集成的更多信息。</a></p>\n<h3 id="开发和生产版本"><a href="#%E5%BC%80%E5%8F%91%E5%92%8C%E7%94%9F%E4%BA%A7%E7%89%88%E6%9C%AC" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>开发和生产版本</h3>\n<p>默认情况下，React 会包含很多有用的警告，这些警告在开发中非常有用。</p>\n<p><strong>然而，这些警告使开发版本的 React 体积过大并且运行过慢，所以你应该在部署应用时使用生产版本</strong></p>\n<p>了解<a href="/docs/optimizing-performance.html#use-the-production-build">如何判断你的网页是否运行了合适的 React 版本</a>, 以及如何有效的配置生产构建程序：</p>\n<ul>\n<li><a href="/docs/optimizing-performance.html#create-react-app">使用 Create React App 构建应用</a></li>\n<li><a href="/docs/optimizing-performance.html#single-file-builds">使用独立文件构建应用</a></li>\n<li><a href="/docs/optimizing-performance.html#brunch">使用 Brunch 构建应用</a></li>\n<li><a href="/docs/optimizing-performance.html#browserify">使用 Browserify 构建应用</a></li>\n<li><a href="/docs/optimizing-performance.html#rollup">使用 Rollup 构建应用</a></li>\n<li><a href="/docs/optimizing-performance.html#webpack">使用 Webpack 构建应用</a></li>\n</ul>\n<h3 id="使用-cdn"><a href="#%E4%BD%BF%E7%94%A8-cdn" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>使用 CDN</h3>\n<p>如果你不想使用 npm 来管理软件包，‘react’ 和 ‘react-dom’ npm 软件包同样提供了托管在 CDN 上的独立文件。</p>\n<div class="gatsby-highlight">\n      <pre class="gatsby-code-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>script</span> <span class="token attr-name">crossorigin</span> <span class="token attr-name">src</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>https://unpkg.com/react@16/umd/react.development.js<span class="token punctuation">"</span></span><span class="token punctuation">></span></span><span class="token script language-javascript"></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>script</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>script</span> <span class="token attr-name">crossorigin</span> <span class="token attr-name">src</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>https://unpkg.com/react-dom@16/umd/react-dom.development.js<span class="token punctuation">"</span></span><span class="token punctuation">></span></span><span class="token script language-javascript"></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>script</span><span class="token punctuation">></span></span>\n</code></pre>\n      </div>\n<p>以上版本仅用于开发，不适合生产。压缩优化的生产版本如下：</p>\n<div class="gatsby-highlight">\n      <pre class="gatsby-code-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>script</span> <span class="token attr-name">crossorigin</span> <span class="token attr-name">src</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>https://unpkg.com/react@16/umd/react.production.min.js<span class="token punctuation">"</span></span><span class="token punctuation">></span></span><span class="token script language-javascript"></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>script</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>script</span> <span class="token attr-name">crossorigin</span> <span class="token attr-name">src</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>https://unpkg.com/react-dom@16/umd/react-dom.production.min.js<span class="token punctuation">"</span></span><span class="token punctuation">></span></span><span class="token script language-javascript"></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>script</span><span class="token punctuation">></span></span>\n</code></pre>\n      </div>\n<p>如果想要加载指定版本的 <code>react</code> 和 <code>react-dom</code>，用版本号替换 16。</p>\n<p>如果你在使用 Bower，可以通过 <code>react</code> 包来使用 React。</p>\n<h4 id="为什么使用-crossorigin-属性"><a href="#%E4%B8%BA%E4%BB%80%E4%B9%88%E4%BD%BF%E7%94%A8-crossorigin-%E5%B1%9E%E6%80%A7" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>为什么使用 <code>crossorigin</code> 属性?</h4>\n<p>如果你从CDN引用react,我们建议保持设置 <a href="https://developer.mozilla.org/en-US/docs/Web/HTML/CORS_settings_attributes"><code>crossorigin</code></a> 属性:</p>\n<div class="gatsby-highlight">\n      <pre class="gatsby-code-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>script</span> <span class="token attr-name">crossorigin</span> <span class="token attr-name">src</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>...<span class="token punctuation">"</span></span><span class="token punctuation">></span></span><span class="token script language-javascript"></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>script</span><span class="token punctuation">></span></span>\n</code></pre>\n      </div>\n<p>We also recommend to verify that the CDN you are using sets the <code>Access-Control-Allow-Origin: *</code> HTTP header:</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/cdn-cors-header-89baed0a6540f29e954065ce04661048-dd807.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 350px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.57142857142857%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Access-Control-Allow-Origin: *"\n        title=""\n        src="/static/cdn-cors-header-89baed0a6540f29e954065ce04661048-dd807.png"\n        srcset="/static/cdn-cors-header-89baed0a6540f29e954065ce04661048-caff8.png 210w,\n/static/cdn-cors-header-89baed0a6540f29e954065ce04661048-dd807.png 350w"\n        sizes="(max-width: 350px) 100vw, 350px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>This enables a better <a href="/blog/2017/07/26/error-handling-in-react-16.html">error handling experience</a> in React 16 and later.</p>',frontmatter:{title:"Installation",next:"hello-world.html",prev:null},fields:{path:"docs/installation.md",slug:"docs/installation.html"}}},pathContext:{slug:"docs/installation.html"}}}});
